import React from "react";

const Noteitem = (props) => {
  const { note } = props;
  return (
    <div className="cold-md-3">
      <div class="card">
        <div class="card-body">
          <h5 class="card-title">{note.title}</h5>
          <p class="card-text">
          {note.description}
          </p>
          <i class="fa fa-trash-alt"></i>
          <i class="fa fa-edit"></i>
        </div>
      </div>
    </div>
  );
};

export default Noteitem;
